import { render } from '@testing-library/react';
import React from 'react';
import Navbar from "./components/Navbar";
import Email from "./components/Email";

class App extends React.Component{
  state = {
    users:[
      {
        id:1,
        name:"john",
        email:"sidaaryan7@gmail.com"
      },
      {
        id:2,
        name:"uiuiui",
        email:"jkjkkj@gmail.com"
      },
      {
        id:3,
        name:"mnb",
        email:"qwe@gmail.com"
      }
    ]
  }

  render(){
    return(
        <div>
          <Navbar/>

          <form className="container my-3">
            <input type="text" className="form-control mb-3" placeholder="Enter Name"></input>

            <input typ="email" className="form-control mb-3" placeholder="enter email"></input>
          </form>


    <h4>{this.state.users.map(user =>(
      <Email key={user.id} name ={user.name} email={user.email}/>
    ))}</h4>
        </div>
    )
  }
}







export default App;
